import { Container, Form, Row, Col } from 'react-bootstrap';

 const Sale = () => {
        return (
            <div>
                <h1>1</h1>
                <div></div>
                <Row>
                    <div class='col align-self-central'>
                    Скидка на всю обувь 500р
                    </div>
                </Row>
            </div>
        )
}

export default Sale
